import React from 'react';

function BoldPlusIcon({ color }) {
  return (
    <svg
      xmlns='http://www.w3.org/2000/svg'
      width='1.25vw'
      height='1.25vw'
      fill='none'
      viewBox='0 0 21 20'
    >
      <rect width='3' height='20' x='9' fill={color} rx='1.5'></rect>
      <rect
        width='3'
        height='21'
        x='21'
        y='8'
        fill={color}
        rx='1.5'
        transform='rotate(90 21 8)'
      ></rect>
    </svg>
  );
}

export default BoldPlusIcon;
